This problem is caused by the fact that the nsPrefix of the generated EPackage ends up being "xml" and according to http://www.w3.org/TR/REC-xml-names/#xmlReserved a prefix may not start with the three letters, xml.  As such, a workaround it to use an ecore:nsPrefix="<some-valie-xmlns-prefix>" annotation on the <schema> element to specify a valid prefix as described by this document: http://www.eclipse.org/emf/docs/overviews/XMLSchemaToEcoreMapping.pdf

Alternatively one could edit the generated .ecore's EPackage to set the nsPrefix that way.

I've changed the XSDEcoreBuilder code to do this:

      // http://www.w3.org/TR/REC-xml-names/#xmlReserved
      // Namespace Constraint: Leading "XML"
      // Prefixes beginning with the three-letter sequence x, m, l, in any case combination, 
      // are reserved for use by XML and XML-related specifications.
      //
      if (nsPrefix.toLowerCase().startsWith("xml"))
      {
        nsPrefix = "_" + nsPrefix;
      }

With C++ code like this:

void foo()
{
   int myint = 11;

   myint++;

   for (int i=0; i<80; i++)
   {
       int myint = 55;
       myint++;
   }
}

Debugger will show the same value for the two different "myint" in details pane of Variable View and in variable hover hint. That's wrong.

The main defect here, IMHO, is that CDT (actually platform ?) does not attach lexical scope info (e.g. line number) to the selected variable in Variable View or Editor View.

