A Set-Cookie header received from a web-server that contains a Expires attribute without an ending semicolon causes NO cookie to be stored in the cookie cache.  This is commonly seen when the Expires attribute is the last attribute in the set-cookie.

For example,
     Set-Cookie: NAME=VALUE; PATH=/; Expires=Wed, Dec-02-2006
as opposed to the following with currently works
     Set-Cookie: NAME=VALUE; PATH=/; Expires=Wed, Dec-02-2006;

All RFC documentation/Browser behavior allow an attribute to end without a semicolon.

Looking at the source of HttpCookieCache for TPTP3.3, you notice line 904 in function parse_cookie

if (chip.expires.equals("") || chip.expires.equals(null) || cflag==false)
   chip.setexpires(new String("EXP"));

cflag will always be false because it can only be set at line 897, which is under the then condition if a ';' is found using indexOf.

